(444, 'Apostrophes for Contraction and Possession', 'adoU1LVy7S.png', NULL, 'These resources will aid you to develop an understanding of the use of the apostrophe, aid you to correctly use apostrophes for contraction and to correctly use apostrophes to show possession.', 'Learnthings', 1, 0, 0, 1, 1, 'ogdeyinka', '2019-10-13 17:37:52', '2019-10-13 17:45:09'),
(445, 'Using Apostrophes for Possession', 'ndKHcwkFAI.png', NULL, 'Apostrophes can be used for shortened forms of words or to mark possession. Of the two, the use of the apostrophe for possession is the most complex. Some pupils will be tempted to use an apostrophe whenever a word ends with an &quot;s&quot;, confusing the plural with ownership.\r\n\r\nThis set of interactive activities examines the use of the apostrophe to indicate both singular and plural ownership. The emphasis is on working orally, so that pupils can see themselves as owners and understand what the apostrophe, in this context, is communicating.\r\n\r\nThe final activity recaps on the use of the apostrophe to signal a missing letter and provides an entertaining game encouraging pupils to make a distinction between the apostrophes of possession and contraction. Throughout the lesson, the emphasis is on collaborative learning, with pupils comparing their answers and justifying their conclusions.', 'Learnthings', 1, 0, 0, 1, 1, 'ogdeyinka', '2019-10-13 17:43:43', '2019-10-13 17:43:51'),
(446, 'Using Apostrophes for Contraction', 'HT3zxtyGVW.png', NULL, 'Apostrophes are used for shortened forms of words or to mark possession. Of the two, the use of apostrophes for contraction is most readily understood. As long as pupils securely grasp the idea that the apostrophe takes the place of a missing letter or letters, they are quick to position it correctly. They should be made aware that contracted forms are more appropriate for speech than for writing.\r\nThis resource will aid you to identify shortened forms and match them to the expanded version. These words are then featured within a pair-matching activity. This activity is done against the clock. The task tests memory and reinforces the relationship between shortened and expanded versions of the same word.', 'Learnthings', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-10-13 17:54:07', '2019-10-13 17:54:07'),
(447, 'Punctuation', 'q7ZbW2Isai.png', NULL, 'This resource will aid you to place and practice punctuation.', '', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-10-13 17:56:49', '2019-10-13 17:56:49'),
