(875, 'Simple Machine: Examples of Wedges', 'BFIrMD2Jc0.png', NULL, 'Learn about wedges as simple machine', 'Harcourt Schools', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-20 14:57:27', '2019-11-20 14:57:27'),
(876, 'Why do some things float or sink', 'oLVTn5uyki.png', NULL, 'Fun game to investigate why some things float and the other things sink.', '', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-20 18:19:36', '2019-11-20 18:19:36'),
(877, 'Atomic Interactions, Van der Waals Force, Pauli Repulsion', 'Crwfs6NP2q.png', NULL, 'This resource will aid you to explore the interactions between various combinations of two atoms.', 'http://phet.colorado.edu/en/simulation/atomic-interactions.html', 0, 0, 0, 3, 1, 'ogdeyinka', '2019-11-20 18:40:04', '2019-11-23 07:14:25'),
(878, 'Balancing Act', 'iPpWEs3Ytm.png', NULL, 'Play with objects on a teeter totter to learn about balance. Test what you&#39;ve learned by trying the Balance Challenge game.', 'http://phet.colorado.edu/en/simulation/balancing-act.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-20 18:54:47', '2019-11-20 18:54:47'),
(879, 'Balloons and Static Electricity', 'wzSKxe8pt1.png', NULL, 'Explore the charges in the sweater, balloons, and the wall as you investigate why a balloon stick to your sweater...', 'http://phet.colorado.edu/en/simulation/balloons-and-static-electricity.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-20 19:00:22', '2019-11-20 19:00:22'),
(880, 'Bending Light (Light Refraction)', 'SZCA6bRoM0.png', NULL, 'Explore bending of light between two media with different indices of refraction. See how changing from air to water to glass changes the bending angle.', 'http://phet.colorado.edu/en/simulation/bending-light.html', 0, 0, 0, 1, 1, 'ogdeyinka', '2019-11-20 19:13:52', '2019-11-26 04:51:13'),
(881, 'Buoyancy', '0Na6sPDgG8.png', NULL, '', 'http://phet.colorado.edu/en/simulation/legacy/buoyancy.html', 0, 0, 0, 49, 1, 'ogdeyinka', '2019-11-20 19:51:59', '2020-05-14 18:34:01'),
(882, 'Build an Atom', 'nDijFsu4zH.png', NULL, 'Build an atom out of protons, neutrons, and electrons, and see how the element, charge, and mass change. Then play a game to test your ideas!', 'http://phet.colorado.edu/en/simulation/build-an-atom.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-20 20:32:23', '2019-11-20 20:32:23'),
(883, 'Capacitor lab', 'dG9RJUSKVO.png', NULL, 'Explore how a capacitor works! Change the size of the plates and the distance between them. Change the voltage and see charges build up on the plates. View the electric field, and measure the voltage. Connect a charged capacitor to a light bulb and observe a discharging RC circuit.', 'http://phet.colorado.edu/en/simulation/capacitor-lab-basics.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-20 21:02:27', '2019-11-20 21:02:27'),
(884, 'Charges And Fields', 'SIpAmGoB9b.png', NULL, 'This resource provides virtual simulation of positive and negative charges in space and the resulting electric field and electrostatic potential. Plot equipotential lines and discover their relationship to the electric field. Create models of dipoles, capacitors, and more!', 'http://phet.colorado.edu/en/simulation/charges-and-fields.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-20 21:15:15', '2019-11-20 21:15:15'),
(885, 'Electric Circuit Construction Virtual Lab.', 'HvuENwA3Bt.png', NULL, 'Experiment with an electronics kit! Build circuits with batteries, resistors, light bulbs, and switches. Determine if everyday objects are conductors or insulators, and take measurements with an ammeter and voltmeter. View the circuit as a schematic diagram, or switch to a lifelike view.', 'http://phet.colorado.edu/en/simulation/circuit-construction-kit-dc.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-20 21:36:22', '2019-11-21 06:19:51'),
(886, 'Collision Lab', '5QFvNlpwUD.png', NULL, 'Use an air hockey table to investigate simple collisions in 1D and more complex collisions in 2D. Experiment with the number of discs, masses, and initial conditions. Vary the elasticity and see how the total momentum and kinetic energy changes during collisions.', 'http://phet.colorado.edu/en/simulation/legacy/collision-lab.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 06:34:38', '2019-11-21 06:34:38'),
(887, 'Color Vision', 'dkBHP5ba7A.png', NULL, 'Make a whole rainbow by mixing red, green, and blue light. Change the wavelength of a monochromatic beam or filter white light. View the light as a solid beam, or see the individual photons.', 'http://phet.colorado.edu/en/simulation/color-vision.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 06:54:32', '2019-11-21 06:54:32'),
(888, 'Density', 'W0NmXTndFR.png', NULL, 'Why do objects like wood float in water? Does it depend on size? Create a custom object to explore the effects of mass and volume on density. Can you discover the relationship?', 'http://phet.colorado.edu/en/simulation/legacy/density.html', 0, 0, 0, 6, 1, 'ogdeyinka', '2019-11-21 07:01:17', '2020-05-01 13:48:08'),
(889, 'Energy Skate Park', 'YPxyTq8aIw.png', NULL, 'Learn about conservation of energy with a skater gal! Explore different tracks and view the kinetic energy, potential energy and friction as she moves. Build your own tracks, ramps, and jumps for the skater.', 'http://phet.colorado.edu/en/simulation/energy-skate-park-basics.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 07:13:37', '2019-11-21 07:13:37'),
(890, 'Faraday&#39;s Law', 'shuePobRCJ.png', NULL, 'Investigate Faraday&#39;s law and how a changing magnetic flux can produce a flow of electricity!', 'http://phet.colorado.edu/en/simulation/faradays-law.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 07:21:07', '2019-11-21 07:22:28'),
(891, 'Forces and Motion', 'Bi2SCjdnFr.png', NULL, 'Explore the forces at work when pulling against a cart, and pushing a refrigerator, crate, or person. Create an applied force and see how it makes objects move. Change friction and see how it affects the motion of objects.', 'http://phet.colorado.edu/en/simulation/forces-and-motion-basics.html', 0, 0, 0, 2, 1, 'ogdeyinka', '2019-11-21 07:35:38', '2020-05-05 16:28:08'),
(892, 'Friction', 'Kb7CwTd9hA.png', NULL, 'Learn how friction causes a material to heat up and melt. Check out what happens on an atomic level when you rub two objects together.', 'http://phet.colorado.edu/en/simulation/friction.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 14:07:50', '2019-11-21 14:07:50'),
(893, 'Geometric Lens Optics', 'wvu6pUWnDy.png', NULL, 'See how light rays are refracted by a lens and watch how the image changes when you adjust the focal length of the lens, move the object, move the lens, or move the screen.', 'http://phet.colorado.edu/en/simulation/legacy/geometric-optics.html', 0, 0, 0, 1, 1, 'ogdeyinka', '2019-11-21 15:07:23', '2019-11-26 04:50:58'),
(894, 'Gravity & Orbits', 'yvHAo0h5Jf.png', NULL, 'Move the sun, earth, moon and space station to see how it affects their gravitational forces and orbital paths. Visualize the sizes and distances between different heavenly bodies, and turn off gravity to see what would happen without it!', 'http://phet.colorado.edu/en/simulation/gravity-and-orbits.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 15:45:06', '2019-11-21 15:45:06'),
(895, 'Gravity Force Attraction Between Two Masses.', '10fFlkbxEV.png', NULL, 'Visualize the gravitational force that two objects exert on each other. Adjust properties of the objects to see how changing the properties affects the gravitational attraction.', 'http://phet.colorado.edu/en/simulation/gravity-force-lab.html', 0, 0, 0, 2, 1, 'ogdeyinka', '2019-11-21 15:50:34', '2019-11-26 04:50:26'),
(896, 'Hooke&#39;s Law', '325NplFy80.png', NULL, 'Stretch and compress springs to explore the relationships between force, spring constant, displacement, and potential energy! Investigate what happens when two springs are connected in series and parallel.', 'http://phet.colorado.edu/en/simulation/hookes-law.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 16:34:40', '2019-11-21 16:34:40'),
(897, 'John Travoltage: Static Electricity', 'x2aI74rJK8.png', NULL, 'Make sparks fly with John Travoltage. Explore how charging Johnnie up and moving his hand changes how he gets shocked!', 'http://phet.colorado.edu/en/simulation/john-travoltage.html', 0, 0, 0, 1, 1, 'ogdeyinka', '2019-11-21 16:47:50', '2019-11-21 16:49:11'),
(898, 'Lunar Landing Game', 'vMiw6oX8CS.png', NULL, 'Can you avoid the boulder field and land safely, just before your fuel runs out, as Neil Armstrong did in 1969? Our version of this classic video game accurately simulates the real motion of the lunar lander with the correct mass, thrust, fuel consumption rate, and lunar gravity. The real lunar lander is very hard to control.', 'http://phet.colorado.edu/en/simulation/legacy/lunar-lander.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 16:59:51', '2019-11-21 16:59:51'),
(899, 'Masses and Spring', 'aL9dI5B3Fm.png', NULL, 'A realistic mass and spring laboratory. Hang masses from springs and adjust the spring stiffness and damping. You can even slow time. Transport the lab to different planets. A chart shows the kinetic, potential, and thermal energy for each spring.', 'http://phet.colorado.edu/en/simulation/legacy/mass-spring-lab.html', 0, 0, 0, 1, 1, 'ogdeyinka', '2019-11-21 17:09:59', '2019-11-22 04:24:33'),
(900, 'Molecles and Light', 'IDJkVEe9P5.png', NULL, 'Do you ever wonder how a greenhouse gas affects the climate, or why the ozone layer is important. Use the sim to explore how light interacts with molecules in our atmosphere.', 'http://phet.colorado.edu/en/simulation/molecules-and-light.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 17:17:03', '2019-11-21 17:17:03'),
(901, 'My Solar System', 'dbZHyi5rkB.png', NULL, 'Build your own system of heavenly bodies and watch the gravitational ballet. With this orbit simulator, you can set initial positions, velocities, and masses of 2, 3, or 4 bodies, and then see them orbit each other.', 'http://phet.colorado.edu/en/simulation/legacy/my-solar-system.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 17:22:55', '2019-11-21 17:22:55'),
(902, 'Normal Mode', 'P3Scj4Kgk8.png', NULL, 'Play with a 1D or 2D system of coupled mass-spring oscillators. Vary the number of masses, set the initial conditions, and watch the system evolve. See the spectrum of normal modes for arbitrary motion. See longitudinal or transverse modes in the 1D system.', 'http://phet.colorado.edu/en/simulation/legacy/normal-modes.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 17:39:20', '2019-11-21 17:39:20'),
(903, 'Ohm&#39;s Law', 'ewMiA0mVXQ.png', NULL, 'See how the equation form of Ohm&#39;s law relates to a simple circuit. Adjust the voltage and resistance, and see the current change according to Ohm&#39;s law.', 'http://phet.colorado.edu/en/simulation/ohms-law.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 17:54:48', '2019-11-21 17:54:48'),
(904, 'Pendulum Lab', '5W6vipCeVR.png', NULL, 'Play with one or two pendulums and discover how the period of a simple pendulum depends on the length of the string, the mass of the pendulum bob, the strength of gravity, and the amplitude of the swing. Observe the energy in the system in real-time, and vary the amount of friction. Measure the period using the stopwatch or period timer. Use the pendulum to find the value of g on Planet X. Notice the anharmonic behavior at large amplitude.', 'http://phet.colorado.edu/en/simulation/pendulum-lab.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 18:08:46', '2019-11-22 04:23:37'),
(905, 'Plinko Probability', 'yGVLeUECzf.png', NULL, 'Drop balls through a triangular grid of pegs and see them accumulate in containers. Switch to a histogram view and compare the distribution of balls to an ideal binomial distribution. Adjust the binary probability and develop your knowledge of statistics', 'http://phet.colorado.edu/en/simulation/plinko-probability.html', 0, 0, 0, 2, 1, 'ogdeyinka', '2019-11-21 18:40:58', '2019-11-22 04:31:20'),
(906, 'Projectile motion', 'vetgMlWdu7.png', NULL, 'Blast a car out of a cannon, and challenge yourself to hit a target! Learn about projectile motion by firing various objects. Set parameters such as angle, initial speed, and mass. Explore vector representations, and add air resistance to investigate the factors that influence drag.', 'http://phet.colorado.edu/en/simulation/projectile-motion.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 18:52:30', '2019-11-21 18:52:30'),
(907, 'Radiating Charge', '1yKGZQNqzP.png', NULL, 'The electric field lines from a point charge evolve in time as the charge moves. Watch radiation propagate outward at the speed of light as you wiggle the charge. Stop a moving charge to see bremsstrahlung (braking) radiation. Explore the radiation patterns as the charge moves with sinusoidal, circular, or linear motion. You can move the charge any way you like, as long as you don’t exceed the speed of light.', 'http://phet.colorado.edu/en/simulation/legacy/radiating-charge.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 19:05:28', '2019-11-22 04:34:34'),
(908, 'Resistance in a Wire', 'TDKLjH3MYP.png', NULL, 'Learn about the physics of resistance in a wire. Change its resistivity, length, and area to see how they affect the wire&#39;s resistance.', 'http://phet.colorado.edu/en/simulation/resistance-in-a-wire.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 19:19:44', '2019-11-22 06:53:25'),
(909, 'Resonance', 'im5LhapoqQ.png', NULL, 'For advanced undergraduate students: Observe resonance in a collection of driven, damped harmonic oscillators. Vary the driving frequency and amplitude, the damping constant, and the mass and spring constant of each resonator. Notice the long-lived transients when damping is small, and observe the phase change for resonators above and below resonance.', 'http://phet.colorado.edu/en/simulation/legacy/resonance.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 19:45:54', '2019-11-21 19:45:54'),
(910, 'Rutherford Scattering', '2cBhYpbV0S.png', NULL, 'How did Rutherford figure out the structure of the atom without being able to see it? Simulate the famous experiment in which he disproved the Plum Pudding model of the atom by observing alpha particles bouncing off atoms and determining that they must have a small core.', 'http://phet.colorado.edu/en/simulation/rutherford-scattering.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 20:00:23', '2019-11-23 20:34:17'),
(911, 'States of Matter', 'aroq32dA6s.png', NULL, 'Watch different types of molecules form a solid, liquid, or gas. Add or remove heat and watch the phase change. Change the temperature or volume of a container and see a pressure-temperature diagram respond in real time. Relate the interaction potential to the forces between molecules.', 'http://phet.colorado.edu/en/simulation/states-of-matter.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 20:27:39', '2019-11-22 07:05:05'),
(912, 'Stern-Gerlach Experiment', 'DZUiQRBKyb.png', NULL, 'The classic Stern-Gerlach Experiment shows that atoms have a property called spin. Spin is a kind of intrinsic angular momentum, which has no classical counterpart. When the z-component of the spin is measured, one always gets one of two values: spin up or spin down.', 'http://phet.colorado.edu/en/simulation/legacy/stern-gerlach.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 20:36:11', '2019-11-21 20:36:11'),
(913, 'Under Pressure', 'bY4TQVduma.png', NULL, 'Explore pressure under and above water. See how pressure changes as you change fluids, gravity, container shapes, and volume', 'http://phet.colorado.edu/en/simulation/under-pressure.html', 0, 0, 0, 2, 1, 'ogdeyinka', '2019-11-21 20:46:16', '2020-05-01 13:35:07'),
(914, 'Wave on a string', 'PvyaSectUZ.png', NULL, 'Explore the wonderful world of waves! Even observe a string vibrate in slow motion. Wiggle the end of the string and make waves, or adjust the frequency and amplitude of an oscillator.', '', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-21 20:52:24', '2019-11-22 06:56:20'),
(915, '(Graph) Curve Fitting', 'ER9mGXbYto.png', NULL, 'With your mouse, drag data points and their error bars, and watch the best-fit polynomial curve update instantly. You choose the type of fit: linear, quadratic, cubic, or quartic. The reduced chi-square statistic shows you when the fit is good. Or you can try to find the best fit by manually adjusting fit parameters.', 'http://phet.colorado.edu/en/simulation/legacy/curve-fitting.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-22 07:16:23', '2019-11-22 07:16:23'),
(916, 'Molecule Polarity', 'B6CmzaXy3J.png', NULL, 'This resource will enable you to see how the molecule behaves in an electric field. Change the bond angle to see how shape affects polarity. Change the electronegativity of atoms in a molecule to see how it affects polarity.', 'http://phet.colorado.edu/en/simulation/molecule-polarity.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-22 07:40:35', '2019-11-22 18:17:06'),
(917, 'Neuron', 'TKltAEnYmv.png', NULL, 'Stimulate a neuron and monitor what happens. Pause, rewind, and move forward in time in order to observe the ions as they move across the neuron membrane.', 'http://phet.colorado.edu/en/simulation/neuron.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-22 20:30:50', '2019-11-22 20:30:50'),
(918, 'pH Scale', 'tzCfAoHaLM.png', NULL, 'Test the pH of things like coffee, spit, and soap to determine whether each is acidic, basic, or neutral. Investigate whether changing the volume or diluting with water affects the pH. Or you can design your own liquid!', 'http://phet.colorado.edu/en/simulation/ph-scale.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-23 06:55:51', '2019-11-23 07:03:13'),
(919, 'Acid-Base Solutions', 'WZ4a5QvFkc.png', NULL, 'Use this resource tool to check how strong and weak acids differ and see how concentration and strength affect pH.', 'http://phet.colorado.edu/en/simulation/acid-base-solutions.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-23 07:05:31', '2019-11-23 07:05:31'),
(920, 'Balancing Chemical Equations', 'x0gwuq8Li5.png', NULL, 'This resource game will aid you to practice balancing of a chemical equation!', 'http://phet.colorado.edu/en/simulation/balancing-chemical-equations.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-23 07:42:56', '2019-11-23 12:50:48'),
(921, 'Concentration & Beer&#39;s Law', 'yNwpQeBx5r.png', NULL, '“The thicker the glass, the darker the brew, the less the light that passes through.” Make colorful concentrated and dilute solutions and explore how much light they absorb and transmit using a virtual spectrophotometer!', 'http://phet.colorado.edu/en/simulation/beers-law-lab.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-23 19:39:27', '2019-11-23 20:16:39'),
(922, 'Isotopes and Atomic Mass', 'rNICLKH2Mt.png', NULL, 'This resource will aid your learning about isotopes and how abundance relates to the average atomic mass of an element.', 'http://phet.colorado.edu/en/simulation/isotopes-and-atomic-mass.html', 0, 0, 0, 1, 1, 'ogdeyinka', '2019-11-23 20:06:49', '2019-11-26 04:48:18'),
(923, 'Molarity', 'mZoxnykj47.png', NULL, 'Learn about the relationships between moles, liters, and molarity by adjusting the amount of solute and solution volume. Change solutes to compare different chemical compounds in water.', 'http://phet.colorado.edu/en/simulation/molarity.html', 0, 0, 0, 1, 1, 'ogdeyinka', '2019-11-23 20:17:07', '2020-02-18 10:49:43'),
(924, 'Molecule Shapes', '3NhPaFbxQd.png', NULL, 'Explore molecule shapes by building molecules in 3D! How does molecule shape change with different numbers of bonds and electron pairs? Find out by adding single, double or triple bonds and lone pairs to the central atom. Then, compare the model to real molecules!', 'http://phet.colorado.edu/en/simulation/molecule-shapes.html', 1, 0, 0, 0, 1, 'ogdeyinka', '2019-11-23 20:22:29', '2019-11-23 20:24:41'),
(925, 'Reactants, Products and Leftovers', 'e8fxc4CHVl.png', NULL, 'Create your own sandwich and then see how many sandwiches you can make with different amounts of ingredients. Do the same with chemical reactions. See how many products you can make with different amounts of reactants. Play a game to test your understanding of reactants, products and leftovers.', 'http://phet.colorado.edu/en/simulation/reactants-products-and-leftovers.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-23 20:30:22', '2019-11-23 20:30:22'),
(926, 'Area Builder', 'xpAFgX2DPe.png', NULL, 'Create your own shapes using colorful blocks and explore the relationship between perimeter and area. Compare the area and perimeter of two shapes side-by-side. Challenge yourself in the game screen to build shapes or find the area of funky figures.', 'http://phet.colorado.edu/en/simulation/area-builder.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-23 20:44:29', '2019-11-23 20:44:29'),
(927, 'Arithmetics', 'e9yjhxf0bK.png', NULL, 'Practice your multiplication, division, and factoring skills with this exciting game. No calculators allowed!', 'http://phet.colorado.edu/en/simulation/arithmetic.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-24 18:26:56', '2019-12-05 14:21:49'),
(928, 'Calculus Grapher', 'JVNTsytfE7.png', NULL, 'Draw a graph of any function and see graphs of its derivative and integral.', 'http://phet.colorado.edu/en/simulation/legacy/calculus-grapher.html', 0, 0, 0, 1, 1, 'ogdeyinka', '2019-11-24 18:37:24', '2020-05-15 22:16:42');
INSERT INTO `resources` (`id`, `title`, `icon`, `resfile`, `info`, `source`, `multilink`, `homepage_show`, `subpage_show`, `clicks`, `active`, `created_by`, `created_at`, `updated_at`) VALUES
(929, 'Equation Grapher', '2kbYp7aTMQ.png', NULL, 'Learn about graphing polynomial equations.', 'http://phet.colorado.edu/en/simulation/legacy/equation-grapher.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-24 18:56:21', '2019-11-24 18:56:21'),
(930, 'Estimation', 'hGOdHawEQ1.png', NULL, 'Explore size estimation in one, two and three dimensions!', 'http://phet.colorado.edu/en/simulation/legacy/estimation.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-24 19:01:43', '2019-11-24 19:01:43'),
(931, 'Equivalent, Evaluating & Simplifying Expressions', 'qeMCYZBKxc.png', NULL, 'Build coin expressions, then exchange them for variable expressions. Simplify and evaluate expressions until you are ready to test your understanding of equivalent expressions in the game!', 'http://phet.colorado.edu/en/simulation/expression-exchange.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-24 19:11:12', '2020-01-06 14:36:53'),
(932, 'Fraction Matcher', 'EQ9rhFRnV4.png', NULL, 'Match shapes and numbers to earn stars in this fractions game. Challenge yourself on any level you like.', 'http://phet.colorado.edu/en/simulation/fraction-matcher.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-24 19:14:12', '2019-11-24 19:14:12'),
(933, 'Function Builder: Basic', 'lDRTCySEQk.png', NULL, 'Play with functions while you ponder Art History. Look for patterns, then apply what you learned on the Mystery screen!', 'http://phet.colorado.edu/en/simulation/function-builder-basics.html', 0, 0, 0, 1, 1, 'ogdeyinka', '2019-11-24 19:41:19', '2020-05-14 21:56:30'),
(934, 'Graphing lines', 'eHxPmuoCnI.png', NULL, 'Explore the world of lines. Investigate the relationships between linear equations, slope, and graphs of lines. Challenge yourself in the line game!', 'http://phet.colorado.edu/en/simulation/graphing-lines.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-24 19:50:30', '2019-11-24 19:50:30'),
(935, 'Graphing Slop-Intercept', 'eI4kP9ENZG.png', NULL, 'Explore slope-intercept form of a line. Connect the slope and y-intercept to the equation of the line. Challenge yourself in the line game!', 'http://phet.colorado.edu/en/simulation/graphing-slope-intercept.html', 0, 0, 0, 0, 1, 'ogdeyinka', '2019-11-24 19:59:15', '2019-11-24 19:59:15'),
