(2131, 'Interpreting Engineering Drawings: Orthographic Projection', 'G0FgiJlO6SjP43TynUQf.png', NULL, 'Learn to develop 2D to 3D visualization skills by examining orthographic projections and using the Glass Box Theory. ', 'https://www.wisc-online.com/GammaPlus/Apps/ViewLearningApp/336', 0, 0, 0, 2, 1, 'ogdeyinka', '2020-05-07 14:43:34', '2020-05-14 23:40:54'),
(2132, 'Basic Symbols Used in Engineering Drawings', 'xFyiQoOA3hjuJalDIdNV.png', NULL, 'Learn the engineering drawing symbols used for counterbore, countersink, spotface, radius, diameter, and depth. In the quiz that completes the activity, they associate these symbols with their matching applications. ', 'https://www.wisc-online.com/GammaPlus/Apps/ViewLearningApp/352', 0, 0, 0, 0, 1, 'ogdeyinka', '2020-05-07 14:50:51', '2020-05-07 14:50:51'),
