(2134, 'The Basic Types of Dimensioning Used in Engineering Drawings', 'mdBwpRQGJ9YEnh43fgk5.png', NULL, 'Learn the basic types of dimensioning including unidirectional and aligned systems, and linear, aligned, angled, arrowless, chain, datum, chart, tabular, radius, diameter, typical, and reference dimensions. ', 'https://www.wisc-online.com/GammaPlus/Apps/ViewLearningApp/564', 0, 0, 0, 1, 1, 'ogdeyinka', '2020-05-07 14:56:57', '2020-05-11 11:11:12'),
(2135, 'Geometric Characteristic Symbols', 'BhTeHGCtnglz2JD95IYs.png', NULL, 'Learn to identify 14 tolerance control symbols used in engineering drawings for machined parts.', 'https://www.wisc-online.com/GammaPlus/Apps/ViewLearningApp/564', 0, 0, 0, 0, 1, 'ogdeyinka', '2020-05-07 14:59:57', '2020-05-07 14:59:57'),
