INSERT INTO `tags` (`id`, `tag`, `def`, `created_at`, `updated_at`) VALUES
(1, 'Addition', 'Addition (often signified by the plus symbol \"+\") is one of the four basic operations of arithmetic; the others are subtraction, multiplication and division. The addition of two whole numbers is the total amount of those values combined. ', '2019-10-01 22:19:55', '2019-11-23 21:47:15'),
(2, 'Subtraction', 'Subtraction is the act of removing a part from a whole. It can as well be defined as an arithmetic operation in which the difference between two numbers is calculated.', '2019-10-01 22:19:55', '2019-11-14 11:56:47'),
