(248, 'Carnivores', 'Carnivore is any any animal that eats meat as the main part of its diet.\nThere are two types of Carnivores: Facultative carnivores, such as dogs, behave more like omnivores as they can eat plant matter along with meat.\nObligate carnivore, such as lions and tigers who eat meat all the time.', '2019-10-27 16:59:29', '2019-11-26 12:36:59'),
