(734, 'Pancreas', 'Pancreas is a large elongated exocrine gland located behind the stomach that secretes pancreatic juice and insulin.', '2019-12-30 01:24:40', '2019-12-30 01:24:40'),
(735, 'Diopters', 'Diopters represent the amount of correction needed in corrective lenses to normalize vision.', '2019-12-30 02:36:10', '2019-12-30 02:36:10'),
(736, 'Myopia', 'Myopia (nearsightedness) is a common vision condition in which you can see objects near to you clearly, but objects farther away are blurry.', '2019-12-30 02:47:05', '2019-12-30 02:47:05'),
(737, 'Astigmatism', 'Astigmatism is a common vision problem caused by an error in the shape of the cornea.', '2019-12-30 02:48:36', '2019-12-30 02:48:36'),
(738, 'Hyperopia', 'Hyperopia (farsightedness) is a vision condition in which distant objects can be seen clearly, but close ones do not come into proper focus.', '2019-12-30 02:53:31', '2019-12-30 02:53:31'),
(739, 'Presbyopia', 'Presbyopia is a condition associated with the aging of the eye that results in progressively worsening ability to focus clearly on close objects.', '2019-12-30 02:55:39', '2019-12-30 02:55:39'),
